  true,\n\t\"url\": null,\n\t\"notes\": \"Wavenumber Calibration Tables from Heterodyne
  Frequency Measurements contains tables of gas-phase infrared transition wavenumbers
  and their spectroscopic assignments that are appropriate for calibrating high-spectral-resolution
  infrared spectrometers. The calibration lines for carbonyl sulfide (OCS), nitrous
  oxide (N2O), nitric oxide (NO), carbonyl sulfide (CS2), and carbon monoxide (CO)
  collectively extend from approximately 486 wavenumber (cm-1) to 4355 wavenumbers
  (cm-1) in the infrared. The bibliography and spectral atlas are current through
  November 1994. The bibliography covers a range of high-resolution spectroscopic
  studies on the calibration molecules listed above, including pressure broadening
  studies.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
